DROP TABLE IF EXISTS `mall_goods_monitor`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `mall_goods_monitor` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(128) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '商品标题',
  `link` varchar(1024) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '商品链接',
  `img_url` varchar(1024) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '首图链接',
  `origin_mall` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '来自于哪个商场',
  `max_price` decimal(10,2) DEFAULT NULL COMMENT '商品的最高监控价格，大于最高价发送邮件通知',
  `min_price` decimal(10,2) NOT NULL COMMENT '商品的最低监控价格，小于最低价发送邮件通知',
  `open_status` bit(1) NOT NULL COMMENT '是否开启监控，1：开启，0：关闭',
  `email` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '发送通知邮件的邮箱地址',
  `delete_status` bit(1) NOT NULL COMMENT '删除状态,0：未删除，1：已删除',
  `create_by` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `create_date` datetime NOT NULL,
  `update_by` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `update_date` date DEFAULT NULL,
  `current_price` decimal(19,2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='需要监控价格的商品表';
